// src/pages/EventsPage.jsx
import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import NewsCard from '../components/NewsCard';
import VideoModal from '../components/VideoModal';
import { fetchAllContent } from '../services/contentService';
import '../styles/CategoryPage.css';

const EventsPage = () => {
  const [content, setContent] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedVideo, setSelectedVideo] = useState(null);
  const [selectedCategory, setSelectedCategory] = useState('All');

  const categories = ['All', 'Music', 'Sports', 'Arts & Culture', 'Food & Drink', 'Community'];

  useEffect(() => {
    const loadEvents = async () => {
      try {
        setLoading(true);
        const query = selectedCategory === 'All'
          ? 'New York events things to do'
          : `New York ${selectedCategory} events`;

        const data = await fetchAllContent({
          query,
          includeVideos: true,
          includeArticles: true
        });

        setContent(data);
      } catch (err) {
        console.error('Error loading events:', err);
      } finally {
        setLoading(false);
      }
    };

    loadEvents();
  }, [selectedCategory]);

  const handleVideoClick = (video) => {
    setSelectedVideo(video);
  };

  const handleCloseModal = () => {
    setSelectedVideo(null);
  };

  return (
    <div className="category-page">
      {/* Hero Section */}
      <motion.div 
        className="category-hero events-hero"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.6 }}
      >
        <div className="page-container">
          <div className="category-hero-content">
            <motion.div
              className="events-icon"
              initial={{ scale: 0, rotate: -180 }}
              animate={{ scale: 1, rotate: 0 }}
              transition={{ delay: 0.2, type: 'spring' }}
            >
              ðŸ“…
            </motion.div>
            <motion.h1 
              className="category-title"
              initial={{ y: 30, opacity: 0 }}
              animate={{ y: 0, opacity: 1 }}
              transition={{ delay: 0.3, duration: 0.6 }}
            >
              NYC Events
            </motion.h1>
            <motion.p 
              className="category-description"
              initial={{ y: 30, opacity: 0 }}
              animate={{ y: 0, opacity: 1 }}
              transition={{ delay: 0.4, duration: 0.6 }}
            >
              Discover concerts, festivals, exhibitions, and community gatherings happening across the city
            </motion.p>
          </div>
        </div>
      </motion.div>

      <div className="page-container">
        {/* Category Filter */}
        <div className="filter-section">
          <h3 className="filter-label">Event Type:</h3>
          <div className="category-filters">
            {categories.map((category) => (
              <button
                key={category}
                className={`filter-btn ${selectedCategory === category ? 'active' : ''}`}
                onClick={() => setSelectedCategory(category)}
              >
                {category}
              </button>
            ))}
          </div>
        </div>

        {/* Content Stats */}
        <div className="content-stats">
          <p>
            {content.length} events found
            {selectedCategory !== 'All' && ` in ${selectedCategory}`}
          </p>
        </div>

        {/* Events Feed */}
        {loading ? (
          <div className="feed-loading">
            <div className="spinner"></div>
            <p>Loading events...</p>
          </div>
        ) : (
          <div className="feed-grid">
            {content.length > 0 ? (
              content.map((item) => (
                <NewsCard 
                  key={item.id} 
                  content={item}
                  onVideoClick={handleVideoClick}
                />
              ))
            ) : (
              <div className="feed-empty">
                <p>No events available for this category.</p>
                <button 
                  className="reset-filter-button"
                  onClick={() => setSelectedCategory('All')}
                >
                  View All Events
                </button>
              </div>
            )}
          </div>
        )}
      </div>

      {/* Video Modal */}
      {selectedVideo && (
        <VideoModal 
          video={selectedVideo} 
          onClose={handleCloseModal} 
        />
      )}
    </div>
  );
};

export default EventsPage;
